import Image from 'react-bootstrap/Image';
import headshot from '.../images/headshot-min.jpg';

function MiddleNav() {
  return (
    <>
      <Image
        roundedCircle
        thumbnail
        className="headshot rounded-circle"
        src={headshot}
        alt="Jeff Berlin headshot"
        title="Jeff Berlin headshot"
      />
    </>
  );
}

export default MiddleNav;
